double predict_speed_x_diff(double speed_x, double accelOrBreak)
{
	int i = (int) (speed_x * 3.6);
	int j = (int) ((accelOrBreak + 1.0) * 10.0);

	i = MAX(i, 0);
	i = MIN(i, MAX_SPEED_X);
	j = MAX(j, 0);
	j = MIN(j, MAX_ACCEL_OR_BRAKE);
	return lut[i][j];
}

